import React from "react";
import { useState } from "react";

const Counter = () => {
  const [state, setState] = useState(0);
  return (
    <div>
      <h1>후원 금액 : {state}</h1>
      <button className="" onClick={() => setState(state + 100)}>
        100원 후원하기
      </button>
    </div>
  );
};

export default Counter;
